import React,{ useRef } from "react";
import styled from "styled-components";

const Input = (props)=> {
    const Ref = useRef();
    const {value, placeholder} =props;

    //value에 따라 값 저장시 분류

    return(
        <React.Fragment>
            <input ref={Ref} placeholder={placeholder}/>
        </React.Fragment>
    )
}


Input.defaultProps = {
    label : "텍스트",
    placeholder: "입력해주세요",
    _onChange: () => {}
}

export default Input ;
